import React from "react";
import { CardMedia } from "@mui/material";

const direcList = [
    {
        id: "00001",
        name: "Nguyễn Nhật Anh",
        avatar: "https://icons-for-free.com/download-icon-business+costume+male+man+office+user+icon-1320196264882354682_512.png"
    },
    {
        id: "00002",
        name: "Phùng Vũ An Quân",
        avatar: "https://cdn-icons-png.flaticon.com/512/206/206853.png"
    },
    {
        id: "00003",
        name: "Nguyễn Quang Nhật Minh",
        avatar: "https://scontent.fdad3-6.fna.fbcdn.net/v/t39.30808-6/301087925_759293918611403_4145865900551381028_n.jpg?_nc_cat=107&ccb=1-7&_nc_sid=09cbfe&_nc_ohc=AL8zC9BQ0LYAX9OsuZq&_nc_oc=AQnCMt8ozzKahnXrkqoA427Jazs4rXAUUn8ZJstLzSdMwv11tqIOIG5u1qrsvnHNp3w&_nc_ht=scontent.fdad3-6.fna&oh=00_AfAYe6NTR6vIyCflZrMXP-Zhm5yXAcIt7dK13O__DDXifQ&oe=6390EFA0"
    },
]

function Friend({info}) {
    return (
        <> 
            <div className="w-full flex">
            <CardMedia
                component="img"
                image={info.avatar || ""}
                title="Title"
                className="w-7 h-[320px]"
                style={{
                  marginBottom: "8px",
                }}
              />
            </div>
        </>
    )
}

function DirecList() {

  return (
    <>
      <div className="w-1/3 h-full flex flex-col border-[1px] border-slate-400 rounded-tl-xl rounded-bl-xl">
        <div className="w-full text-lg font-medium text-center border-b-[1px] border-slate-400 py-2">
          Trò chuyện
        </div>
        <div className="relative flex justify-center mt-2">
          <input
            className="w-11/12 border-[1px] border-slate-400 rounded-xl py-1 pl-8 outline-none"
            placeholder="Tìm kiếm liên hệ..."
          ></input>
          <div className="absolute left-0 h-full flex items-center justify-center">
            <i className="fa-solid fa-magnifying-glass text-slate-400 ml-7"></i>
          </div>
        </div>
        <div className="w-full flex flex-col mt-2">
            {
                direcList.map((friend, index) => (
                    <Friend info={friend}></Friend>
                ))
            }
        </div>
      </div>
    </>
  );
}

export default DirecList;
